import React from "react";
import AdminNavbar from "./DashboardComponents/AdminDashNav";
import AdminSidebar from "./DashboardComponents/Adminsidebar";
import AdminDashboardCards from "./DashboardComponents/Dasboardcards";
import chartplacehoolder from "../../../assets/chartplaceholder.png";
import "./index.css";

const AdminDashboard = () => {
  return (
    <>
      <div className="contaniner-fluid">
        <div className="row">
          <AdminSidebar />
          <div className="col-md-9 dashboardmainarea">
            <AdminNavbar />
            <div className="dashboard_main_area row">
              <AdminDashboardCards />
            </div>
            <div className="row">
            <div className="col-md-7">
              <img src={chartplacehoolder} className="chartplacehoolder" alt="" />
            </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default AdminDashboard;
